def plotting(history_bce, history_mse,title):
  plt.figure(figsize=(20,5))
  plt.subplot(121)
  plt.plot(history_bce.loss)
  plt.title('Binary Cross entropy Loss vs Epoch'); plt.ylabel('Loss'); plt.xlabel('Epoch')
  plt.legend(['train','test']); 
  plt.subplot(122);
  plt.plot(history_mse.loss)
  plt.title('Mean Squared Error Loss vs Epoch'); plt.ylabel('Loss'); plt.xlabel('Epoch')
  plt.legend(['train','test']); plt.suptitle(title); plt.show();
def plotting2(history,title):
  plt.figure(figsize=(20,5))
  plt.subplot(121)
  plt.plot(history.accuracy)
  plt.plot(history.val_accuracy)
  plt.title('Accuracy vs Epoch'); plt.ylabel('Accuracy'); plt.xlabel('Epoch')
  plt.legend(['train','test']); 
  plt.subplot(122);
  plt.plot(history.loss)
  plt.plot(history.val_loss)
  plt.title('Loss vs Epoch'); plt.ylabel('Loss'); plt.xlabel('Epoch')
  plt.legend(['train','test']); plt.suptitle(title); plt.show();
